import React from "react";
import './App.css'
const Nav = ()=>{
return(
    <div className="navbar">
       <div className="container">
       <ul>
       <a href = '#'>Logo</a>
    
       <a href = '/'>Home</a>
       <a href = '/about'>About</a> 
       </ul>
    </div>\
    </div>
)
}
export default Nav;
